/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
    var length = s.length;
    if (length === 0) return 0;
    var allStr = {};
    var start = 0;
    var res = 0;
    var filterStr = '';
    var i = 0;

    console.time('iterater')
    for (var i = 0; i < length; i++) {
        if ((allStr[s[i]] || allStr[s[i]] == 0) && allStr[s[i]] >= start) {
            console.log('change start');
            console.log('current =>', allStr, '---', s[i]);
            start = allStr[s[i]] + 1;
            console.log('obj :', allStr);
            console.log('start : ', start);
        }
        allStr[s[i]] = i;
        console.log('i : %s , start : %s , length : %s', i, start, i - start + 1);

        res = ((a, b) => {
            return a > b ? a : b;
        })(res, (i - start + 1))
    }
    console.log('all -> ', allStr);

    //
    // while (i < length) {
    //   var currentStrArr = s[i];
    //   var j = i + 1;
    //   for (j; j < length; j++) {
    //     if (currentStrArr.indexOf(s[j]) > -1) {
    //       break;
    //     }
    //     currentStrArr += s[j];
    //   }
    //   i++;
    //   // console.log('i : %s', i);
    //   // console.log('j : %s', j);
    //   // console.log('length : %s', length);
    //   if (filterStr.length < currentStrArr.length) filterStr = currentStrArr;
    //   if (j === length) i = length;
    // }



    console.timeEnd('iterater')
    return res;
    // console.log('filterStr : ', filterStr);
    // return filterStr.length;
};

